import React from 'react';
import {
  ListItem,
  Grid,
  Stack,
  Typography,
  Box,
  LinearProgress,
  IconButton,
  Chip
} from '@mui/material';
import { Calendar, ChevronRight } from 'lucide-react';
import StatusChip from './StatusChip.tsx';

const SubscriptionItem = ({ subscription, onClick }) => {
  // Calculate usage percentage
  const usagePercentage = 100 - (subscription.days_remaining / 30 * 100);

  return (
    <ListItem 
      alignItems="flex-start"
      sx={{ 
        p: 0,
        mb: 2,
        '&:last-child': { mb: 0 }
      }}
    >
      <Box
        onClick={onClick}
        sx={{
          width: '100%',
          p: 3,
          borderRadius: 2,
          background: 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
          border: '1px solid',
          borderColor: 'divider',
          position: 'relative',
          overflow: 'hidden',
          cursor: 'pointer',
          transition: 'all 0.3s cubic-bezier(0.4, 0, 0.2, 1)',
          '&:hover': {
            transform: 'translateY(-2px)',
            boxShadow: '0 8px 24px rgba(0,0,0,0.08)',
            borderColor: subscription.status === 'active' ? 'success.main' : 
                         subscription.days_remaining <= 15 ? 'warning.main' : 'error.main',
            '&::before': {
              opacity: 1
            }
          },
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            height: '3px',
            background: subscription.status === 'active' 
              ? 'linear-gradient(90deg, #4ade80, #22c55e)' 
              : subscription.days_remaining <= 15 
                ? 'linear-gradient(90deg, #fbbf24, #f59e0b)' 
                : 'linear-gradient(90deg, #f87171, #ef4444)',
            opacity: 0,
            transition: 'opacity 0.3s ease'
          }
        }}
      >
      <Grid container spacing={2} alignItems="center">
        <Grid item xs={12} sm={6}>
          <Stack direction="column" spacing={1}>
            <Typography variant="subtitle1" fontWeight="bold">
              {subscription.bundle_name?.toUpperCase() || 'SUBSCRIPTION'}
            </Typography>
            <Stack direction="row" spacing={1} alignItems="center">
              <StatusChip status={subscription.status} />
              <StatusChip 
                status={subscription.payments?.length > 0 ? 'paid' : 'unpaid'} 
                variant="outlined" 
              />
            </Stack>
          </Stack>
        </Grid>

        <Grid item xs={6} sm={3}>
          <Stack direction="column" spacing={0.5}>
            <Typography variant="caption" color="text.secondary">
              Expiry Date
            </Typography>
            <Stack 
              direction="row" 
              spacing={1} 
              alignItems="center"
              sx={{
                transition: 'all 0.2s ease',
                '&:hover': {
                  color: 'primary.main'
                }
              }}
            >
              <Calendar size={14} />
              <Typography variant="body2">
                {new Date(subscription.expire_date).toLocaleDateString('en-US', {
                  year: 'numeric',
                  month: 'long',
                  day: 'numeric'
                })}
              </Typography>
            </Stack>
            {subscription.days_remaining > 0 && subscription.days_remaining <= 30 && (
              <Typography 
                variant="caption" 
                color={subscription.days_remaining <= 15 ? "warning.main" : "text.secondary"}
                sx={{
                  transition: 'all 0.2s ease',
                  '&:hover': {
                    fontWeight: 'bold'
                  }
                }}
              >
                {subscription.days_remaining} days remaining
              </Typography>
            )}
          </Stack>
        </Grid>

        <Grid item xs={6} sm={3}>
          <Stack direction="column" spacing={0.5}>
            <Typography variant="caption" color="text.secondary" display="block">
              Usage
            </Typography>
            <Box 
              sx={{ 
                width: '100%', 
                maxWidth: 150,
                transition: 'all 0.3s ease',
                '&:hover': {
                  transform: 'scale(1.05)'
                }
              }}
            >
              <LinearProgress 
                variant="determinate" 
                value={usagePercentage} 
                sx={{
                  height: 6,
                  borderRadius: 3,
                  mb: 0.5,
                  '& .MuiLinearProgress-bar': {
                    transition: 'transform 0.8s ease'
                  }
                }}
                color={
                  usagePercentage > 80 ? "error" :
                  usagePercentage > 60 ? "warning" : "primary"
                }
              />
              <Typography variant="caption">
                {Math.round(usagePercentage)}% used
              </Typography>
            </Box>
          </Stack>
        </Grid>

        {/* Action Arrow */}
        <Grid item xs={12} sm="auto" sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end' }}>
          <IconButton 
            size="small"
            sx={{ 
              bgcolor: 'rgba(103, 126, 234, 0.1)',
              border: '1px solid rgba(103, 126, 234, 0.2)',
              transition: 'all 0.3s ease',
              '&:hover': {
                bgcolor: 'rgba(103, 126, 234, 0.2)',
                transform: 'translateX(3px)',
                boxShadow: '0 4px 12px rgba(103, 126, 234, 0.25)'
              }
            }}
          >
            <ChevronRight size={16} />
          </IconButton>
        </Grid>
      </Grid>
      </Box>
    </ListItem>
  );
};

export default SubscriptionItem;
